No ato da matrícula, os classificados deverão apresentar os seguintes documentos, que serão retidos para formação de prontuário e cadastro de alunos, em cópia legível e autenticada ou cópias legíveis e originais para autenticação no ato da matrícula:
I - Documentos de cadastro e de identificação do candidato:
a)	Documento de Identificação Oficial com foto;
b)	Cadastro de Pessoa Física (CPF);
c)	Certidão de quitação eleitoral emitida pelo Cartório Eleitoral ou no site do TSE (maiores de 18 anos);
d)	Comprovação de quitação com o serviço militar para maiores de 18 anos do sexo masculino;
e)	Certidão de casamento (caso o nome seja diferente dos demais documentos pessoais);
f)	Histórico Escolar do Ensino Médio;
g)	Certificado de Conclusão do Ensino Médio.
h)	Ficha de Dados Cadastrais e Declaração de Informações Pessoais - DIP (sobre vínculo, origem escolar, renda, étnico-racial) preenchida (ANEXO III);
i)	01(uma) fotografia original recente do candidato, no formato 3x4.
j)	O protocolo do Sistema de Avaliação Socioeconômica (Sistema Sase) da Univasf, gerado após preencher as informações e postar os documentos comprobatórios para todos os grupos; postar os documentos comprobatórios de renda para os Grupos L1, L2, L9 e L10; e postar os documentos comprobatórios de deficiência para os Grupos L9, L10, L13 e L14.

II - Documento que prove a responsabilidade legal sobre o candidato
a)	Documento de identificação dos pais, no caso da matrícula ser realizada pelos pais, EXCLUSIVAMENTE para o candidato menor de idade; ou
b)	Documento que comprove a tutela ou que detém a guarda, no caso da matrícula ser realizada por pessoas que não são os pais biológicos, EXCLUSIVAMENTE para candidato menor de idade; ou
c)	Procuração com firma reconhecida em cartório dando poderes para realizar a matrícula, com a apresentação de original e cópia da identidade do procurador, no caso de impedimento do próprio candidato, se maior de idade, ou dos pais, se candidato menor de idade.

III - Documentos para os candidatos classificados nas vagas reservadas (Grupos L1 a L14):

a)	Certificado de conclusão do ensino médio, com o respectivo histórico escolar, comprovando ter estudado INTEGRALMENTE o Ensino Médio em escolas públicas, em cursos regulares ou no âmbito da modalidade de Educação de Jovens e Adultos ou tenham obtido certificado de conclusão com base no resultado do Exame Nacional do Ensino Médio - Enem, do Exame Nacional para Certificação de Competências de Jovens e Adultos - ENCCEJA ou de exames de certificação de competência ou de avaliação de jovens e adultos realizados pelos sistemas estaduais de ensino.
b)	Laudo Médico comprobatório da deficiência declarada com CID correspondente (Obrigatório para os optantes das vagas destinadas a pessoas com deficiência: Grupos L9, L10, L13 e L14), emitido nos últimos 12 (doze) meses anteriores à data de abertura das inscrições ao Sisu 1º/2020, no qual conste a dificuldade apresentada pelo(a) candidato(a) para o exercício ou desempenho de atividades acadêmicas. Somente serão considerados os laudos emitidos por especialistas na área da deficiência e/ou condição declarada pelo(a) candidato(a), com explicitação do número do registro profissional. Eventuais fraudes identificadas a qualquer tempo ensejarão a perda da vaga, sem prejuízo de eventuais medidas legais cabíveis. 
c)	Autodeclaração sobre sua raça, por meio do preenchimento da DIP - Obrigatório para os Grupos L2, L6, L10 e L14.
